import { useLocation } from 'react-router-dom';
import { useState, useEffect } from 'react';

 const SeeDivisions = () => {
    const location = useLocation();
    const queryParams = new URLSearchParams(location.search);
    const tournament_id = queryParams.get('tournament_name');
    const [date,setData] = useState([]);

    useEffect(() => {
        // Check if accessToken exists in localStorage
        const accessToken = localStorage.getItem("accessToken");
        if (!accessToken) {
          // Handle the case where accessToken is not available
          console.error('Access token not found. API request not made.');
          return;
        }
      
        // Fetch data from the backend API
        axios.get('http://localhost:3001/divisions', {
          headers: {
            accessToken: accessToken,
          },
        })
          .then(response => {
            if (response.data.error) {
              alert(response.data.error);
            } else {
              setData(response.data);
            
            }
          })
          .catch(error => {
            console.error('Error fetching data:', error);
          });
      }, []);
  return (
    <div>
        <table>
            <thead>
                <tr>
                    <th>Tournament Name</th>
                    <th>Age Group</th>
                    <th>Pofeciancy Level</th>
                </tr>
            </thead>
        </table>
    </div>
  )
}

export default SeeDivisions;
